Outer join in mongodb using $lookup<p>I have a <strong>Channels</strong> collection</p>

<pre><code>{
  channel: "Xamper",  //unique
  subscribers: [
    ObjectId("5a934e000102030405000000"),
    ObjectId("5a934e000102030405000001"),
    ObjectId("5a934e000102030405000002")
  ]
}
</code></pre>

<p>And a  <strong>Users</strong> collection</p>

<pre><code>{
  _id: ObjectId("5a934e000102030405000000"),
  name: "Bradman"
},
{
  _id: ObjectId("5a934e000102030405000001"),
  name: "Hartin"
},
{
  _id: ObjectId("5a934e000102030405000002"),
  name: "Migra"
},
{
  _id: ObjectId("5a934e000102030405000004"),
  name: "Polycor"
}
</code></pre>

<p>Now I need to find with <strong>Channel</strong> name <code>"Xamper"</code> and count the users which are not in <code>subscribers</code> array</p>

<p>So the output will be</p>

<pre><code>{
  channel: "Xamper",
  unSubscribers: 1
}
</code></pre>

<p>Which is similar to the outer excluding join of SQL</p>

<p><a href="https://i.stack.imgur.com/Dh9oG.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/Dh9oG.png" alt="enter image description here"></a></p>

