How to add a field to array of subdocuments in all the documents in mongodb?<p>I have collection like below:-</p>

<pre><code>{
   _id: 123,
   images: [{
     _id: ObjectId("213"),
     id: "1"
   }]
}
</code></pre>

<p>I want to add a field <code>imageResourceID</code> that is dependent on the <code>id</code> field.</p>

<pre><code>{
   _id: 123,
   images: [{
     _id: ObjectId("213"),
     id: "1",
     imageResourceID: "1"
   }]
}
</code></pre>

<p><strong>What I tried?</strong></p>

<pre><code>db.collection.aggregate([
  { "$addFields": {
    "images.imageResourceID": {
        "$map": {
        "input": "$otherImages",
        "as": "image",
        "in": "$$image.id"
      }
    }
  }}
])
</code></pre>

<p>It adds <code>imageResourceID</code> field as an array containing <code>id</code> fields of all of the sub documents.
How can I make it to add <code>imageResourceID</code> field having value equal to the <code>id</code> field? </p>

<p>Thanks in advance. I am new to <code>MongoDB</code> so please bear with me.</p>

