MongoDB save() creating new document each time rather than updating existing document<p>I'm using this function to save to mongodb:</p>

<pre><code>create(req, res, next) {
  let data = req.body;
  if(data) {
    let newIssue = this.lib.db.model('Issues')('data');
    console.log(newIssue);
    newIssue.save((err, emp) =&gt; {
      if(err) return next(this.RESTError('InternalServerError', err));
      this.writeHAL(res, emp);
    });
  } else {
    next(this.RESTError('InvalidArgumentError', 'No data received'));
  }
}
</code></pre>

<p>This is my schema:</p>

<pre><code>module.exports = {
  "id": "Issues",
  "properties": {
    "issue_title": {
      "type": "string",
      "description": "The title of the issue"
    },
    "issue_number": {
      "type": "string",
      "description": "The issue number"
    },
    "issue_url": {
      "type": "string",
      "description": "URL of the issue"
    }
  }
}
</code></pre>

<p>My understanding of <code>save()</code> is that if the document already exists in mongodb it gets updated but a new one is created if it doesn't already exist. However, each time I POST the same document, a new document is inserted rather than the existing one getting updated. I have a suspicion this is because when saving, an <code>_id</code> key containing a unique ID is added to my schema making the document unique. Is this correct and if so how do I resolve this?</p>

<p><strong>Additional info</strong></p>

<p>I've now added a PUT. the idea is that I would do an update with <code>{upsert:true}</code>. I've it partially working in that I can PUT to <code>issue/{id} where</code>{id}<code>is the mongodb</code>_id` and update existing documents.</p>

<p>This is my PUT:</p>

<pre><code>update(req, res, next) {
  let data = req.body;
  let id = req.params.id;
  if(id) {
    this.lib.db.model('Issues')
      .findOne({_id: id})
      .exec((err, updateIssue) =&gt; {
        if(err) return next(this.RESTError('InternalServerError', err));
        updateIssue = Object.assign(updateIssue, data);
        updateIssue.update((err, issue) =&gt; {
          if(err) return next(this.RESTError('InternalServerError', err));
          this.writeHAL(res, issue);
        });
      });
  }
}
</code></pre>

<p>This is the routing:</p>

<pre><code>    controller.addAction({
      'path': '/issues/{id}',
      'method': 'PUT',
      'summary': "UPDATES the issues's information",
      'params': [swagger.pathParam('id', 'The id of the issue', 'string'),
    swagger.bodyParam('issue', 'the new information to update', 'string')],
      'responseClass': 'Issues',
      'nickname': 'updateIssue'
    }, controller.update);
</code></pre>

<p>I don't think I can use this for upsert as I have no <code>_id</code> to begin with so can;t create the path. My other option is to use the <code>github_id</code>. however any time I try to cahnge my routing path to <code>/issues/{github_id}</code> or update my function with something like <code>.findOne({github_id: id})</code> I get an error. I need to be able to use <code>/issues/{github_id}</code> and for the check to see if the <code>github_id</code> already exists. If it does, update the document, if not, create a new one.</p>

<p><strong>Further info.</strong></p>

<p>I've changed my update function to:</p>

<pre><code>update(req, res, next) {
  let data = req.body;
  let id = req.params.id;
  if(id) {
    this.lib.db.model('Issues')
      .findOne({_id: id})
      .exec((err, updateIssue) =&gt; {
        if(err) return next(this.RESTError('InternalServerError', err));
        updateIssue = Object.assign(updateIssue, data);
        updateIssue.update({_id: id}, data, (err, issue) =&gt; {
          if(err) return next(this.RESTError('InternalServerError', err));
          this.writeHAL(res, issue);
        });
      });
  }
}
</code></pre>

<p>If I add the following <code>console.log</code>'s after line <code>updateIssue.update({_id: id}, data, (err, issue) =&gt; {</code>:</p>

<pre><code>console.log('id: ', id);
console.log('data: ', data);
console.log('err: ', err);
console.log('issue: ', issue);
</code></pre>

<p>I get this output:</p>

<pre><code>id:  5b80307403eea4f14b06fe8c
data:  { _id: '5b80307403eea4f14b06fe8c',
  github_id: '347593262',
  issue_title: 'test issue XY',
  issue_number: '2',
  issue_url: 'https://api.github.com/repos/PCTestOrg/test1/issues/2a',
  __v: 0 }
err:  null
issue:  { n: 1, nModified: 0, ok: 1 }
